import React from "react";
import { Avatar } from "react-lorem-ipsum";
import "./profile.css";


function Profile(props)
{
    return (
        <div className="modal fade" id="staticBackdrop" data-bs-backdrop="static" data-bs-keyboard="false" tabindex="-1" aria-labelledby="staticBackdropLabel" aria-hidden="true">
            <div className="modal-dialog bg-dark border-styles">
                <div className="modal-content  bg-dark">
                    <div className="modal-header bg-dark">
                        <h1 className="modal-title fs-5 text-light" id="staticBackdropLabel">{props.name}</h1>
                        <div data-bs-theme="light">
                            <button data-bs-theme="dark" type="button" className="btn-close" data-bs-dismiss="modal" aria-label="Close"></button>
                        </div>                    
                    </div>
                    <div className="modal-body text-light">
                        <p>About: </p>
                        <p>...</p>
                    </div>
                    <div className="modal-footer">
                        <button type="button" className="btn btn-secondary" data-bs-dismiss="modal">Close</button>
                        <button type="button" className="btn btn-primary">Understood</button>
                    </div>
                </div>
            </div>
        </div>
    )
}


export default Profile;
